int initialize(){

    char* Plt = "Altera";

    //Get PlatformID
    platform = find_Platform(Plt);

    //Get DeviceID
    //
    err = clGetDeviceIDs(platform, CL_DEVICE_TYPE_ALL, 1, &device, NULL);
    checkerror(err,"Error: Failed to get DeviceID!");
    // Create a compute context
    //
    context = clCreateContext(NULL, 1, &device, NULL, NULL, &err);
    checkerror(err,"Error: Failed to Create context!");
    // Create a command queue
    //
    queue[0] = clCreateCommandQueue(context, device, CL_QUEUE_PROFILING_ENABLE, &err);
    checkerror(err,"Error: Failed to create a command queue[0]!");

    //queue[1] = clCreateCommandQueue(context, device, CL_QUEUE_PROFILING_ENABLE, &err);
    //checkerror(err,"Error: Failed to create a command queue[1]!");

    string binary_file = getBoardBinaryFile("kernel_b", device);
    printf("Using AOCX: %s\n", binary_file.c_str());
    program = createProgramFromBinary(context, binary_file.c_str(), &device, 1);

    if (!program)
    {
        printf("Error: Failed to create compute program!\n");
        return EXIT_FAILURE;
    }

    // Build the program executable
    //
    err = clBuildProgram(program, 0, NULL, NULL, NULL, NULL);
    if (err != CL_SUCCESS)
    {
        size_t len;
        char buffer[4096];
        printf("Error: Failed to build program executable!\n");
        clGetProgramBuildInfo(program, device, CL_PROGRAM_BUILD_LOG, sizeof(buffer), buffer, &len);
        printf("%s\n", buffer);
        exit(1);
    }

    // Create the compute kernel in the program we wish to run
    //
    kernel[0] = clCreateKernel(program, "Conv1", &err);
    checkerror(err,"Error: Failed to create compute kernel[0]!");

    //kernel[1] = clCreateKernel(program, "conv2", &err);
    //checkerror(err,"Error: Failed to create compute kernel[1]!");

    // Create the input and output arrays in device memory for our calculation
    //
    x = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(bool) * 128 * 34 * 34, NULL, NULL);
    y = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(int) * 128 * 32 * 32, NULL, NULL);
    z = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(int) * 128 * 34 * 34, NULL, NULL);
    a = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(int) * 128 * 32 * 32, NULL, NULL);

    return 0;
}

void run(){

    // Write our data set into the input array in device memory
    //
    //err = clEnqueueWriteBuffer(queue[0], x, CL_TRUE, 0, sizeof(float) * N, Y1, 0, NULL, NULL);
    //checkerror(err,"Error: Failed to write to source array!");

    // Set the arguments to our compute kernel
    //
    err = clSetKernelArg(kernel[0], 0, sizeof(cl_mem), &x);
    err = clSetKernelArg(kernel[0], 1, sizeof(cl_mem), &y);
    err = clSetKernelArg(kernel[0], 2, sizeof(cl_mem), &z);
    err = clSetKernelArg(kernel[0], 3, sizeof(cl_mem), &a);


    checkerror(err,"Error: Failed to set kernel arguments! - kernel[0]");

    // Execute the kernel over the entire range of our 1d input data set
    global = {1,1};
    err = clEnqueueNDRangeKernel(queue[0], kernel[0], 2, NULL, global, NULL, 0, NULL, NULL);
    checkerror(err,"Error: Failed to execute kernel[0]");

    //err = clEnqueueNDRangeKernel(queue[0], kernel[1], 2, NULL, global, NULL, 0, NULL, NULL);
    //checkerror(err,"Error: Failed to execute kernel[1]");

    clFinish(queue[0]);
    //clFinish(queue[1]);
    err = clEnqueueReadBuffer( queue[0] , x, CL_TRUE, 0, sizeof(bool) * 128 * 34 * 34, (void *) X1, 0, NULL, NULL );
    err = clEnqueueReadBuffer( queue[0] , y, CL_TRUE, 0, sizeof(int) * 128 * 32 * 32, (void *) Y1, 0, NULL, NULL );
    err = clEnqueueReadBuffer( queue[0] , z, CL_TRUE, 0, sizeof(int) * 128 * 32 * 32, (void *) Y2, 0, NULL, NULL );
    err = clEnqueueReadBuffer( queue[0] , a, CL_TRUE, 0, sizeof(int) * 128 * 32 * 32, (void *) Y3, 0, NULL, NULL );
    printf("Complete ");

    correct=0;
    int count=0;
    int flag=0;
    for(unsigned char i = 0; i < 128; i++){
        for(unsigned char j = 0; j < 32; j++){
            for(unsigned char k = 0; k < 32; k++){
                count++;
                if(Y2[(j * 32) + k + (i * (32*32))] == fmap0[i][j+1][k+1])
                    correct++;
                    //if(act1[i][j][k] == Y1[(j * 18) + k + (i * (18*18))])
                    //	correct++;
                    //else if(X1[(j * 18) + k + (i * (18*18))] == 0)
                    //	correct++;
                else
                    flag++;
            }
        }
        if(flag > 0)
            printf("Matrix %d - %d\n",i,flag);
        flag=0;
    }
    printf("\nNo. of Data Correct for temp1  %d / %d\n",correct,count);

}
void cleanup(){
    clReleaseMemObject(x);
    clReleaseMemObject(y);
    clReleaseMemObject(z);
    clReleaseMemObject(a);
    clReleaseProgram(program);
    clReleaseKernel(kernel[0]);
    clReleaseCommandQueue(queue[0]);
    //clReleaseKernel(kernel[1]);
    //clReleaseCommandQueue(queue[1]);
    clReleaseContext(context);
    free(X1);
    free(Y1);

}
